import logo from "./logo.svg";
import "./App.css";


function App() {
  return (
    <div className="App">
        <header className="header">
          <img src="https://upload.wikimedia.org/wikipedia/commons/d/db/Zeronet_logo.png" alt="" />
        </header>
        <nav className="nav">
          <div>
         <a href=""> Profile </a> 
         </div>
         <div>
         <a href=""> Messages </a> 
         </div>
         <div></div>
         <a href=""> News </a> 
         <a href=""> Music </a> 
         <a href=""> Settings </a> 
         </nav>
        <main className="content">Main content</main>
    </div>  
  );
}

export default App;
